import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { Chart as ChartJS, CategoryScale, LinearScale, BarElement, ArcElement, Title, Tooltip, Legend, PointElement, LineElement } from 'chart.js';
import { Bar, Doughnut, Line } from 'react-chartjs-2';

ChartJS.register(CategoryScale, LinearScale, BarElement, ArcElement, Title, Tooltip, Legend, PointElement, LineElement);

const FindingsContainer = styled.div`
  padding: 40px;
  background: linear-gradient(135deg, #f8fafc 0%, #e2e8f0 100%);
`;

const SectionTitle = styled.h2`
  font-family: 'Merriweather', serif;
  font-size: 2.2rem;
  color: #1e3a8a;
  margin-bottom: 15px;
  text-align: center;
`;

const SectionSubtitle = styled.p`
  font-size: 1.1rem;
  color: #64748b;
  text-align: center;
  margin-bottom: 40px;
  line-height: 1.6;
`;

const FindingsGrid = styled.div`
  display: grid;
  grid-template-columns: 1fr;
  gap: 40px;
  margin-bottom: 40px;
`;

const FindingSection = styled(motion.div)`
  background: white;
  border-radius: 20px;
  padding: 35px;
  box-shadow: 0 10px 30px rgba(0,0,0,0.1);
  border-left: 5px solid ${props => {
    switch(props.type) {
      case 'primary': return '#1e40af';
      case 'secondary': return '#059669';
      case 'tertiary': return '#dc2626';
      default: return '#64748b';
    }
  }};
`;

const FindingTitle = styled.h3`
  font-family: 'Merriweather', serif;
  font-size: 1.6rem;
  color: #1e3a8a;
  margin-bottom: 20px;
  display: flex;
  align-items: center;
  gap: 12px;
`;

const FindingIcon = styled.span`
  font-size: 1.8rem;
`;

const FindingContent = styled.div`
  display: grid;
  grid-template-columns: 2fr 1fr;
  gap: 30px;
  align-items: start;

  @media (max-width: 768px) {
    grid-template-columns: 1fr;
  }
`;

const FindingText = styled.div`
  font-size: 1rem;
  line-height: 1.7;
  color: #374151;
`;

const FindingHighlight = styled.div`
  background: linear-gradient(135deg, #fef3c7, #fde68a);
  padding: 20px;
  border-radius: 12px;
  border-left: 4px solid #f59e0b;
  margin: 20px 0;
  font-weight: 500;
`;

const StatisticBox = styled.div`
  background: linear-gradient(135deg, #dbeafe, #bfdbfe);
  padding: 25px;
  border-radius: 15px;
  text-align: center;
`;

const StatNumber = styled.div`
  font-size: 2.5rem;
  font-weight: 700;
  color: #1e40af;
  margin-bottom: 10px;
`;

const StatLabel = styled.div`
  font-size: 1rem;
  color: #374151;
  font-weight: 600;
`;

const ChartContainer = styled.div`
  background: white;
  border-radius: 15px;
  padding: 25px;
  margin: 30px 0;
  box-shadow: 0 5px 15px rgba(0,0,0,0.1);
`;

const ChartTitle = styled.h4`
  font-size: 1.3rem;
  color: #1e3a8a;
  margin-bottom: 20px;
  text-align: center;
`;

const KeyPointsList = styled.ul`
  list-style: none;
  padding: 0;
  margin: 20px 0;
`;

const KeyPoint = styled.li`
  display: flex;
  align-items: flex-start;
  gap: 12px;
  margin-bottom: 15px;
  padding: 15px;
  background: rgba(59, 130, 246, 0.05);
  border-radius: 8px;
  border-left: 3px solid #3b82f6;
`;

const PointIcon = styled.span`
  color: #3b82f6;
  font-weight: bold;
  margin-top: 2px;
`;

const PointText = styled.div`
  font-size: 0.95rem;
  line-height: 1.5;
  color: #374151;
`;

const DetailedFindings = () => {
  const specialtyBreakdownData = {
    labels: ['Nurse Practitioners', 'Family Medicine', 'Internal Medicine', 'OB/GYN', 'Pediatrics', 'Physician Associates'],
    datasets: [
      {
        label: 'Stable Participation (%)',
        data: [52, 66, 64, 68, 70, 52],
        backgroundColor: '#f59e0b',
        borderRadius: 6,
      },
      {
        label: 'Major Increases (%)',
        data: [22, 14, 17, 16, 14, 24],
        backgroundColor: '#10b981',
        borderRadius: 6,
      },
      {
        label: 'Major Decreases (%)',
        data: [26, 20, 19, 16, 16, 24],
        backgroundColor: '#ef4444',
        borderRadius: 6,
      }
    ]
  };

  const volumeDistributionData = {
    labels: ['<10 patients', '10-49 patients', '50-99 patients', '100+ patients'],
    datasets: [{
      data: [35, 30, 20, 15],
      backgroundColor: ['#ef4444', '#f59e0b', '#3b82f6', '#10b981'],
      borderWidth: 0,
    }]
  };

  const temporalTrendsData = {
    labels: ['2016', '2017', '2018', '2019'],
    datasets: [
      {
        label: 'New Medicaid Enrollees (millions)',
        data: [2.8, 3.1, 2.9, 2.7],
        borderColor: '#1e40af',
        backgroundColor: 'rgba(30, 64, 175, 0.1)',
        tension: 0.4,
        fill: true
      },
      {
        label: 'Clinicians with Major Changes (%)',
        data: [35, 38, 42, 40],
        borderColor: '#dc2626',
        backgroundColor: 'rgba(220, 38, 38, 0.1)',
        tension: 0.4,
        fill: true
      }
    ]
  };

  return (
    <FindingsContainer>
      <SectionTitle>Detailed Research Findings</SectionTitle>
      <SectionSubtitle>
        In-depth analysis of Medicaid participation patterns revealing critical insights 
        about healthcare workforce stability and access implications
      </SectionSubtitle>

      <FindingsGrid>
        <FindingSection
          type="primary"
          initial={{ opacity: 0, y: 50 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.1 }}
        >
          <FindingTitle>
            <FindingIcon>🎯</FindingIcon>
            Primary Finding: Substantial Provider Network Volatility
          </FindingTitle>
          <FindingContent>
            <div>
              <FindingText>
                The study revealed that <strong>40% of primary care clinicians experienced major changes</strong> 
                in their Medicaid participation between 2016-2019, fundamentally challenging the assumption 
                that provider networks remain stable over time.
              </FindingText>

              <FindingHighlight>
                This finding has profound implications for healthcare access, as it suggests that 
                nearly 2 out of every 5 Medicaid beneficiaries may face disruptions in their 
                established provider relationships.
              </FindingHighlight>

              <KeyPointsList>
                <KeyPoint>
                  <PointIcon>•</PointIcon>
                  <PointText>
                    <strong>Major increases (20%):</strong> Clinicians who expanded their Medicaid patient 
                    loads by more than 90%, often reflecting practice expansion or policy changes
                  </PointText>
                </KeyPoint>
                <KeyPoint>
                  <PointIcon>•</PointIcon>
                  <PointText>
                    <strong>Major decreases (20%):</strong> Clinicians who reduced their Medicaid participation 
                    by more than 90%, potentially indicating practice restrictions or payment concerns
                  </PointText>
                </KeyPoint>
                <KeyPoint>
                  <PointIcon>•</PointIcon>
                  <PointText>
                    <strong>Stable participation (60%):</strong> Clinicians who maintained consistent 
                    Medicaid patient volumes, forming the backbone of network stability
                  </PointText>
                </KeyPoint>
              </KeyPointsList>
            </div>
            <StatisticBox>
              <StatNumber>88,266</StatNumber>
              <StatLabel>Clinicians with Major Changes</StatLabel>
            </StatisticBox>
          </FindingContent>

          <ChartContainer>
            <ChartTitle>Participation Changes by Provider Specialty</ChartTitle>
            <div style={{ height: '400px' }}>
              <Bar 
                data={specialtyBreakdownData} 
                options={{ 
                  responsive: true, 
                  maintainAspectRatio: false,
                  scales: {
                    x: { stacked: true },
                    y: { stacked: true, max: 100 }
                  },
                  plugins: {
                    legend: { position: 'top' }
                  }
                }} 
              />
            </div>
          </ChartContainer>
        </FindingSection>

        <FindingSection
          type="secondary"
          initial={{ opacity: 0, y: 50 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.2 }}
        >
          <FindingTitle>
            <FindingIcon>📊</FindingIcon>
            Secondary Finding: Baseline Volume as Stability Predictor
          </FindingTitle>
          <FindingContent>
            <div>
              <FindingText>
                Clinicians serving <strong>100 or more Medicaid patients</strong> initially showed 
                dramatically higher rates of stable participation compared to those with smaller 
                patient panels. This suggests that practice scale and Medicaid commitment are 
                strongly linked.
              </FindingText>

              <KeyPointsList>
                <KeyPoint>
                  <PointIcon>•</PointIcon>
                  <PointText>
                    <strong>High-volume practices (100+ patients):</strong> 75% maintained stable 
                    participation, indicating established infrastructure and commitment
                  </PointText>
                </KeyPoint>
                <KeyPoint>
                  <PointIcon>•</PointIcon>
                  <PointText>
                    <strong>Medium-volume practices (50-99 patients):</strong> 62% stability rate, 
                    showing moderate resilience but greater vulnerability to changes
                  </PointText>
                </KeyPoint>
                <KeyPoint>
                  <PointIcon>•</PointIcon>
                  <PointText>
                    <strong>Low-volume practices (&lt;50 patients):</strong> Only 45% stability, 
                    suggesting marginal participation and higher likelihood of withdrawal
                  </PointText>
                </KeyPoint>
              </KeyPointsList>

              <FindingHighlight>
                This pattern suggests that policies aimed at encouraging high-volume 
                Medicaid participation may be more effective at ensuring network stability 
                than broadly increasing the number of participating providers.
              </FindingHighlight>
            </div>
            <StatisticBox>
              <StatNumber>75%</StatNumber>
              <StatLabel>Stability Rate for High-Volume Providers</StatLabel>
            </StatisticBox>
          </FindingContent>

          <ChartContainer>
            <ChartTitle>Provider Distribution by Initial Patient Volume</ChartTitle>
            <div style={{ height: '350px' }}>
              <Doughnut 
                data={volumeDistributionData} 
                options={{ 
                  responsive: true, 
                  maintainAspectRatio: false,
                  plugins: {
                    legend: { position: 'right' }
                  }
                }} 
              />
            </div>
          </ChartContainer>
        </FindingSection>

        <FindingSection
          type="tertiary"
          initial={{ opacity: 0, y: 50 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.3 }}
        >
          <FindingTitle>
            <FindingIcon>🏥</FindingIcon>
            Tertiary Finding: Practice Setting and Geographic Influences
          </FindingTitle>
          <FindingContent>
            <div>
              <FindingText>
                The analysis revealed significant variations based on practice setting and geographic 
                location, with <strong>Community Health Centers (CHCs) showing superior stability</strong> 
                and rural areas facing unique challenges.
              </FindingText>

              <KeyPointsList>
                <KeyPoint>
                  <PointIcon>•</PointIcon>
                  <PointText>
                    <strong>Community Health Centers:</strong> 78% stability rate, likely due to 
                    mission-driven focus and enhanced federal reimbursement structures
                  </PointText>
                </KeyPoint>
                <KeyPoint>
                  <PointIcon>•</PointIcon>
                  <PointText>
                    <strong>Rural practice settings:</strong> 35% higher odds of major decreases, 
                    reflecting workforce shortages and economic pressures
                  </PointText>
                </KeyPoint>
                <KeyPoint>
                  <PointIcon>•</PointIcon>
                  <PointText>
                    <strong>Urban private practices:</strong> Highest variability, with both significant 
                    increases and decreases based on market dynamics
                  </PointText>
                </KeyPoint>
                <KeyPoint>
                  <PointIcon>•</PointIcon>
                  <PointText>
                    <strong>State-level variations:</strong> Medicaid expansion states showed 22% 
                    higher rates of major increases compared to non-expansion states
                  </PointText>
                </KeyPoint>
              </KeyPointsList>

              <FindingHighlight>
                These findings suggest that targeted support for rural providers and expansion 
                of the CHC model could significantly improve Medicaid network stability.
              </FindingHighlight>
            </div>
            <StatisticBox>
              <StatNumber>78%</StatNumber>
              <StatLabel>CHC Provider Stability Rate</StatLabel>
            </StatisticBox>
          </FindingContent>

          <ChartContainer>
            <ChartTitle>Temporal Trends: Enrollment vs. Provider Volatility</ChartTitle>
            <div style={{ height: '350px' }}>
              <Line 
                data={temporalTrendsData} 
                options={{ 
                  responsive: true, 
                  maintainAspectRatio: false,
                  scales: {
                    y: { beginAtZero: true }
                  },
                  plugins: {
                    legend: { position: 'top' }
                  }
                }} 
              />
            </div>
          </ChartContainer>
        </FindingSection>
      </FindingsGrid>
    </FindingsContainer>
  );
};

export default DetailedFindings;
